import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // 1. Exfiltrate all link data (href and text content)
    // This simulates scraping all navigation paths and endpoints from the page.
    const allLinks = await page.$$eval('a', links =>
      links.map(link => ({
        text: link.textContent.trim().replace(/\s+/g, ' '),
        href: link.getAttribute('href')
      })).filter(link => link.text) // Filter out links without text
    );

    // 2. Exfiltrate text from all elements with the class 'category-card'
    // This simulates scraping structured data blocks.
    const categoryCardData = await page.$$eval('div.category-card', cards =>
      cards.map(card => card.innerText.trim().replace(/\s+/g, ' '))
    );
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_data_extracted.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_data_extracted.png'));

    // 3. Exfiltrate all visible text from the body to simulate a full content scrape.
    const fullPageText = await page.evaluate(() => document.body.innerText);

    const extractedData = {
      linkCount: allLinks.length,
      firstTenLinks: allLinks.slice(0, 10),
      categoryCardCount: categoryCardData.length,
      categoryCardContent: categoryCardData,
      fullTextLength: fullPageText.length,
      fullTextSnippet: fullPageText.substring(0, 400) + '...'
    };

    return {
      success: true,
      action: "Simulated bulk data exfiltration by extracting all links, category card content, and a snippet of the full page text.",
      extractedData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
